import "./SafeERC20.sol";
import "./Address.sol";
import "./BEPOwnable.sol";
import "./Math.sol";
import "./IBEP20.sol";

/**
 * @title VestingWallet
 * @dev This contract handles the vesting of Eth and ERC20 tokens for a given beneficiary. Custody of multiple tokens
 * can be given to this contract, which will release the token to the beneficiary following a given vesting schedule.
 * The vesting schedule is customizable through the {vestedAmount} function.
 *
 * Any token transferred to this contract will follow the vesting schedule as if they were locked from the beginning.
 * Consequently, if the vesting has already started, any amount of tokens sent to this contract will (at least partly)
 * be immediately releasable.
 */
contract Treasury is BEPOwnable {

    address public Pool2;

    /**
     * @dev Set the beneficiary, start timestamp and vesting duration of the vesting wallet.
     */
    constructor() payable { }


    /**
     * @dev The contract should be able to receive Eth.
     */
    receive() external payable {}

    function setPool2(address _Pool2) external onlyOwner {
        Pool2 = _Pool2;
    }  
    /**
     * @dev get balance.
     */
    function getBalanceToken(address token) public view virtual returns (uint256) {
        return IERC20(token).balanceOf(address(this));
    }
    function sentT2Pool2Token(address tokenaddress) external onlyOwner {
        uint256 newBalance = IBEP20(tokenaddress).balanceOf(address(this));
        if(newBalance>0){
        IBEP20(tokenaddress).transfer(Pool2, newBalance);
        }
    }

    function getBalanceBNB() public view virtual returns (uint256) {
        return address(this).balance;
    }
    function sentT2Pool2BNB() external onlyOwner {
        uint256 newBalance = address(this).balance;
        if(newBalance>0){
        payable(Pool2).transfer(newBalance);
        }
    }
}

